import React from "react";
import "./output.css";
import Profile_Pic from "./profilepic";
import HeaderText from "./headertext";
import DescText from "./description_text";
function Test() {
  return (
    <React.Fragment>
      <div className="w-[25vw] h-[85.4vh] mx-[12vw] mt-[7vh] sticky bg-[#303131] border border-white rounded-3xl grid grid-rows-[11fr_2fr_2fr_2fr_4fr]">
        <div className="border-b border-white flex justify-center items-center">
          <Profile_Pic />
        </div>

        <div className="border-b border-white flex justify-center items-center">
          <HeaderText line1="Mrinal Kalita" />
        </div>
        <div className="border-b border-white flex flex-col items-center gap-4">
          <DescText text="Software Engineer & Data Analyst" />

          <DescText text="Guwahati, India" />
        </div>
        <div className="border-b border-white flex justify-center items-center"></div>
        <div className=" flex justify-center items-center"></div>
      </div>
    </React.Fragment>
  );
}

export default Test;
